    public NeuralNetwork GetNeuralNetworkTrained(int index)
    {
        // will load the nn from player prefs or null if it doesn't exist
        NeuralNetwork nn;
        if (!PlayerPrefs.HasKey("" + index))
        {
            return null;
        }
        string trainedNN = PlayerPrefs.GetString("" + index);
        nn = StringToNeuralNetwork(trainedNN);
        return nn;
    }
    public NeuralNetwork StringToNeuralNetwork(string str)
    {
        //splits into 4
        string[] chunks = str.Split('|');
        int nSize = int.Parse(chunks[0]);
        int cSize = int.Parse(chunks[1]);

        string[] neurons = chunks[2].Split('*');
        string[] connections = chunks[3].Split('*');

        NeuralNetwork nn = new NeuralNetwork();
        //Debug.Log("Neuron Length" + neurons.Length);
        //Debug.Log("Connection Length" + connections.Length);

        int x;
        for (x = 0; x < neurons.Length; x++)
        {
            string[] rowColl = neurons[x].Split('_');
            int row = int.Parse(rowColl[0]);
            int coll = int.Parse(rowColl[1]);
            if (row == -1)
            {
                nn.AddCollumn(coll);
            }
            else
            {
                nn.AddNeuron(coll, row);
            }
        }

        int leftRow, leftColl, rightRow, rightColl;
        float value;
        for (x = 0; x < connections.Length; x++)
        {
            string[] connPieces = connections[x].Split('_');
            leftRow = int.Parse(connPieces[0]);
            leftColl = int.Parse(connPieces[1]);
            rightRow = int.Parse(connPieces[2]);
            rightColl = int.Parse(connPieces[3]);
            value = float.Parse(connPieces[4]);
            nn.AddConnection(leftColl, leftRow, rightColl, rightRow, value);
        }

        return nn;
    }


